import React from 'react';
import {useState} from 'react';
import './App.css';
import GetAllAccounts from "./ApiAcount/GetAllAccounts";
import GetAccountByID from "./ApiAcount/GetAccountById";


function App() {
    const [id, setId] = useState('')
    const [users, setUsers] = useState('')

    setUsers(GetAllAccounts.map)

  return (
      <div>
          <input onChange={event => setId(event.target.value)} />
          <button onClick={GetAccountByID(id)}>Get user by ID</button>
          <button onClick={GetAllAccounts}>Get all users</button>

          <table>
              <tr>
                  <th>User</th>
              </tr>
              {users.map(user => (
                      <tr>
                          <td>{user}</td>
                      </tr>
                  ))}

          </table>

      </div>
  );
}

export default App;
